import React from 'react';

function TileDisplay({ tile }) {
  if (!tile) return <div>No current tile</div>;

  return (
    <div className="current-tile">
      <h3>Current Tile:</h3>
      <div className="hex-cell">
        <div className="vertical">{tile.vertical}</div>
        <div className="lower-right">{tile.lowerRight}</div>
        <div className="upper-left">{tile.upperLeft}</div>
      </div>
    </div>
  );
}

export default TileDisplay;
